DROP TABLE IF EXISTS `etudiants`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `etudiants` (
  `codeEtudiant` int(11) NOT NULL,
  `annee` varchar(45) NOT NULL DEFAULT '',
  `age` int(11) DEFAULT NULL,
  `sexe` varchar(45) DEFAULT NULL,
  `nationalite` varchar(45) DEFAULT NULL,
  `bac` varchar(45) DEFAULT NULL,
  `ville` varchar(45) DEFAULT NULL,
  `niveau` varchar(45) DEFAULT NULL,
  `csp` int(11) DEFAULT NULL,
  `lv2` varchar(45) DEFAULT NULL,
  `provenance` varchar(45) DEFAULT NULL,
  `filiere` varchar(45) DEFAULT NULL,
  `nbRattrapage` int(11) DEFAULT '0',
  PRIMARY KEY (`codeEtudiant`,`annee`),
  KEY `codeEtudiant` (`codeEtudiant`),
  KEY `age` (`age`),
  KEY `nationalite` (`nationalite`),
  KEY `bac` (`bac`),
  KEY `ville` (`ville`),
  KEY `csp` (`csp`),
  KEY `provenance` (`provenance`),
  CONSTRAINT `codeEtudiant` FOREIGN KEY (`codeEtudiant`) REFERENCES `d_etu` (`codeEtudiant`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `age` FOREIGN KEY (`age`) REFERENCES `d_age` (`age`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `nationalite` FOREIGN KEY (`nationalite`) REFERENCES `d_nationalite` (`nationalite`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `bac` FOREIGN KEY (`bac`) REFERENCES `d_bac` (`bac`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `ville` FOREIGN KEY (`ville`) REFERENCES `d_geo` (`ville`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `csp` FOREIGN KEY (`csp`) REFERENCES `d_csp` (`csp`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `provenance` FOREIGN KEY (`provenance`) REFERENCES `d_provenance` (`provenance`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

